import React from 'react'
import {FeatureContainer, FeatureButton} from './ClothingElements';

const Clothing = () => {
    return (
        <FeatureContainer>
            <h1>We even have various varities of Clothing</h1>
            <p>BeMyStyle simplifies clothing for you with our best selections</p>
            <FeatureButton>Explore Styles</FeatureButton>
        </FeatureContainer>
    )
}

export default Clothing
